import React from 'react';

const LoginForm = (props) => {
    return (
        <div>
            <h1>login</h1>
            <form>
                <div>
                    <input  placeholder={"Login"}/>
                </div>
                <div>
                    <input placeholder={"Password"}/>
                </div>
                <div>
                    <input type={"checkbox"}/> remember me
                </div>
                <div>
                    <button>login</button>
                </div>
            </form>
        </div>
    );
};

export default Login;
